from itertools import count, takewhile
def ok(n):
  s = str(n*n); return len(s.rstrip("5")) == len(s.lstrip("5")) == len(s)-1
def aupto(N):
  r = takewhile(lambda x: x<=N, (10*i+5 for i in count(0)))
  return [k for k in r if ok(k)]
